import React, { Component, Fragment } from 'react';
import { Router, Route, Switch } from 'react-router-dom';
import HomePage from '../pages/HomePage';

import SignIn from '../pages/signIn-signUp/signIn';
import routeSignUp from '../pages/signIn-signUp/signUpCompany.jsx';
import signUpCompany from '../pages/signIn-signUp/signUpCompany.jsx';
import signUpMedicalStudent from '../pages/signIn-signUp/signUpMedicalStudent.jsx';
import signUpConsumer from '../pages/signIn-signUp/signUpConsumer.jsx';
import forgottenPassword from '../pages/signIn-signUp/forgottenPassword.jsx';


class AppRoute extends Component {
  render() {
    return (
      <Fragment>
        <Switch>
            <Route exact path = "/" component={HomePage} />

            <Route path = "/signIn">
            <SignIn />
            </Route>

            <Route path = "/routeSignUp" component={routeSignUp} />
            <Route path = "/signUpConsumer" component={signUpConsumer} />
            <Route path = "/signUpCompany" component={signUpCompany} />
            <Route path = "/signUpMedicalStudent" component={signUpMedicalStudent} />
            <Route path = "/forgottenPassword" component={forgottenPassword} />

            <Route path = "/" component={HomePage} />
            <Route path = "/" component={HomePage} />
            <Route path = "/" component={HomePage} />
            <Route path = "/" component={HomePage} />
            <Route path = "/" component={HomePage} />

        </Switch>
      </Fragment>
    )
  }
}

export default AppRoute
